import React, { Component } from 'react';

class FormComponent extends Component {
  constructor () {
    super();
    this.state = {
      email: ''
    }
  }

  changeHandler = event => {
    this.setState({
      email: event.target.value
    });
  }

  render () {
    return (
      <form>
          <input type="email" 
                 name="email"   
                 value={this.state.email} 
                 onChange={this.changeHandler} 
          />
      </form>
    );        
  }
}

export default FormComponent;
